eval("module.exports = JSON.parse('{\"nav_sol\":\"The RDI-Manager solution ?\",\"nav_sol_product\":\"Platform\",\"nav_sol_why\":\"Why RDI-Manager ?\",\"nav_sol_partner\":\"Our partners\",\"nav_sol_guide\":\"User manual\",\"nav_sol_offer\":\"Our offers\",\"nav_features\":\"Features\",\"nav_feat_keyfact\":\"Remarkable facts\",\"nav_feat_timesheet\":\"Time entry\",\"nav_feat_strat\":\"Strategic analysis\",\"nav_feat_role\":\"Roles, rights & security\",\"nav_feat_organigram\":\"Hierarchical links\",\"nav_feat_planning\":\"Planning\",\"nav_feat_strategic\":\"Strategic analysis\",\"nav_startup\":\"The start-up\",\"nav_startup_about\":\"About\",\"nav_startup_team\":\"Our team\",\"nav_startup_value\":\"Our values\",\"nav_startup_partners\":\"Our partners\",\"nav_startup_user_manual\":\"User manual\",\"nav_contact\":\"Contact\",\"nav_contact_form\":\"Contact us\",\"nav_contact_join\":\"Join us\",\"nav_pricing\":\"Offers\",\"nav_free\":\"Log In\",\"sign_up\":\"Sign up\",\"subTitle_video\":\"RDI-MANAGER nominated among the 6 most innovative Tech2022 in France.\",\"big_title\":\"A collaborative project diary for your R&D&I activity\",\"index_para_home\":\"Let\\'s reinvent project management thanks to the collaborative journal which, in addition to the capitalization of knowledge, allows team monitoring and project management.\",\"try_demo\":\"Try our demo\",\"home_btn_video\":\"See in video\",\"mixte_logiciel\":\"Interconnectable with\",\"step_one\":\"Why RDI Manager ?\",\"step_one_para\":\"Manage your activity in a simple, efficient and structured manner.\",\"index_para_text_one\":\"Pour plus de\",\"index_para_text_two\":\"les entreprises innovantes ont besoin d’\",\"index_para_text_three\":\"dans leur approche de \",\"index_para_one\":\" compétitivité et d\\'efficacité en RDI,\",\"index_para_two\":\"excellence et de fluidité\",\"index_para_three\":\"management de l’innovation.\",\"card_one_step_title\":\"Collaborative monitoring of projects\",\"card_two_step_title\":\"Time tracking by project\",\"card_three_step_title\":\"File management by project\",\"card_one_step_para\":\"Create your projects in a few clicks, invite your stakeholders (contributors and observers) and follow the progress of the projects through the remarkable fact provided by your collaborators.\",\"card_two_step_para\":\"Your collaborators periodically inform in 2 clicks their time spent on each project (per day, week or month). The timesheets are thus created and usable in histogram or in pdf and/or xls files.\",\"card_three_step_para\":\"Your cloud storage space for files per project allows you to classify them, archive them, and even associate them with remarkable fact. They are available to stakeholders.\",\"step_partners\":\"Our partners\",\"step_partners_para\":\"They trust us\",\"see_all_partners\":\"See all our partners\",\"step_two\":\"They use RDI-Manager\",\"step_two_para\":\"They use RDI-Manager to follow their innovative activity and more.\",\"share_card_one\":\"\\\\\" The platform RDI-Manager truly answers to an unfulfilled need of management in innovation. Other than the efficient project tracking, we don\\'t need to remind our engineers for to enter their time in. \\\\\"\",\"share_card_two\":\"\\\\\" At Bloom-At-Work, we are always very interested in innovative solutions in all sorts, as long as they improve well-being at work.\\\\\"\",\"share_card_three\":\"\\\\\" We have been looking for a long time for a simple and efficient solution to track the time. RDI-Manager answers to this need and it allows us to be more efficient in our project tracking. \\\\\"\",\"share_card_four\":\"\\' Very intuitive and effective tool for collaborative work; could be very useful for our university partners. \\'\",\"share_card_five\":\"\\' Simple and very practical software for real-time industrial traceability and multi-site and multi-company activity management. \\'\",\"share_card_six\":\"\\' Simple and relevant web application; it allows us to adopt good RDI practices from the start. I highly recommend. \\'\",\"band_big_title\":\"3 months of free trial\",\"band_para\":\"Enjoy three months of free trial during which you can follow as many projects as your company creates. Invite all of the involved parties (Administrators, Project managers, Contributors and Observers).\",\"band_button\":\"Ask for your free trial\",\"step_three\":\"Our offers\",\"step_three_para\":\"An offer that adjusts itself according to your financial, operational and strategic issues. Our offer helps from growing start-ups to big industrial groups, including PME and established start-ups.\",\"card_one_title\":\"Starter Offer\",\"card_one_for\":\"By user/month\",\"card_one_sale\":\"Free\",\"card_one_small\":\"for a good start\",\"card_one_line_one\":\"5 users\",\"card_one_line_two\":\"2 observers\",\"card_one_line_three\":\"5 projects\",\"card_one_line_four\":\"1 Go of storage\",\"card_one_line_five\":\"Cloud plateform\",\"card_one_line_six\":\"E-mail assistance\",\"card_one_line_seven\":\"Size of Remarkable facts limited\",\"card_one_line_eight\":\"Project planning & monitoring\",\"card_one_button\":\"Sign up\",\"card_two_title\":\"Standard\",\"card_two_for\":\"By user/ month\",\"card_two_sale\":\"10€\",\"card_two_small\":\"or 100€ by year\",\"card_two_line_one\":\"Unlimited users\",\"card_two_line_two\":\"Unlimited observers\",\"card_two_line_three\":\"Unlimited projects\",\"card_two_line_four\":\"Unlimited folders*\",\"card_two_line_five\":\"Cloud plateform\",\"card_two_line_six\":\"E-mail assistance & telephone\",\"card_two_line_seven\":\"Size of Remarkable facts configurable \",\"card_two_line_eight\":\"Commentary on Remarkable facts\",\"card_two_line_nine\":\"Visibility rights by files\",\"card_two_line_ten\":\"Advanced project planning & monitoring\",\"card_two_line_twelve\":\"Time Tracking SMS Reminder\",\"card_two_line_thirteen\":\"Multi-company dashboards\",\"card_two_line_fourteen\":\"Project performance indicators\",\"card_two_line_fifteen\":\"Getting started support\",\"card_two_line_sixteen\":\"Budget monitoring by project**\",\"card_two_button\":\"Contact us\",\"card_three_title\":\"Premium\",\"card_three_for\":\"By company/year\",\"card_three_sale\":\"Package\",\"card_three_small\":\"Custom\",\"card_three_line_one\":\"Unlimited users\",\"card_three_line_two\":\"Unlimited observers\",\"card_three_line_three\":\"Unlimited projects\",\"card_three_line_four\":\"Unlimited folders*\",\"card_three_line_five\":\"Cloud platerform\",\"card_three_line_six\":\"E-mail assistance & telephone\",\"card_three_line_seven\":\"Size of Remarkable facts limited\",\"card_three_line_eight\":\"Commentary on Remarkable facts\",\"card_three_line_nine\":\"Visibility rights by files\",\"card_three_line_ten\":\"Advanced project planning & monitoring\",\"card_three_line_eleven\":\"Task progress notification\",\"card_three_line_twelve\":\"Time Tracking SMS Reminder\",\"card_three_line_thirteen\":\"Multi-company dashboards\",\"card_three_line_fourteen\":\"Project performance indicators\",\"card_three_line_fifteen\":\"Getting started support\",\"card_three_line_sixteen\":\"Budget monitoring by project\",\"card_three_line_seventeen\":\"Hierarchical links\",\"card_three_line_eighteen\":\"Self-hosting of your choice\",\"card_three_line_nineteen\":\"Installation and technical support\",\"card_three_button\":\"Contact us\",\"footer_about\":\"About us\",\"footer_follow\":\"Follow us\",\"footer_contact\":\"Contact us\",\"asterisk_price\":\"(*) : Storage within file size limits.\",\"asterisk_price_two\":\"(**) : Paid feature available as an option.\",\"fm_big_title\":\"Monitoring of the remarkable facts\",\"fm_big_title_collab\":\"The collaborative project diary\",\"fm_para\":\"With RDI-Manager, enter your projects\\' remarkable facts from your computer or from your phone.\",\"fm_step_button\":\"Discover the remarkable facts\",\"fm_card_one_title\":\"Remarkable facts\",\"fm_card_one_addfm\":\" Add a remarkable fact\",\"fm_card_one_date_author\":\"Date | Author\",\"fm_card_one_date_author_title\":\"Title\",\"fm_card_two_title\":\"Stock your files\",\"fm_subject\":\"It allows you to concretely put the progress of the work into perspective, both for you and for your stakeholders.\",\"fm_big_title_archive\":\"Saving and archiving project files\",\"fm_project_file\":\"The files linked to the project are made available to project stakeholders, directly in the collaborative journal of the project.\",\"st_big_title\":\"Monitor the time spent\",\"st_para\":\"With RDI-Manager, enter the time spent on your projects simply and efficiently from your computer or your phone.\",\"st_step_one_button\":\"Discover our system to enter your time\",\"st_card_one_title\":\"Create timesheets\",\"st_card_two_title\":\"Enter your time\",\"st_card_two_project_one\":\"Project CAR\",\"st_card_two_project_two\":\"Project REX\",\"st_card_three_title\":\"Enter the absences\",\"st_card_three_day_one\":\"mon\",\"st_card_three_day_two\":\"tues\",\"st_card_three_day_three\":\"wed\",\"st_card_three_day_four\":\"thurs\",\"st_card_three_day_five\":\"fri\",\"st_card_three_day_six\":\"sat\",\"st_card_three_day_seven\":\"sun\",\"st_card_three_full_day\":\"Full days\",\"st_card_three_half_day\":\"Half days\",\"st_card_three_week_end\":\"Weekend and public holidays\",\"st_big_title_sms\":\"SMS recovery\",\"st_text_sms\":\"It allows employees not to forget the entry of their time on the various projects.\",\"st_title_monthly_entry\":\"Monthly time entry\",\"st_title_weekly_entry\":\"Weekly time entry\",\"st_weekly_entry\":\"With more precision and as much efficiency and simplicity, the entry of weekly time is done also as a percentage on the projects.\",\"st_title_daily_entry\":\"Daily time entry\",\"st_daily_entry\":\"If you prefer to track your time by the day, you will do so by the hour, every week. In any case, you have the SMS reminder.\",\"sa_big_title_analysis\":\"Global business analysis\",\"sa_text_analysis\":\"With RDI-Manager, all employees are entitled to an overview of their activity. The strategic analyzes of each user\\'s dashboard relate to all the projects for which he is involved. This reinforces the commitment of the troops in their projects.\",\"sa_stat_title_one\":\"Contributors\",\"sa_stat_title_two\":\"Remarquable facts\",\"sa_stat_title_three\":\"RDI score\",\"sa_stat_text_one\":\"RDI eligibility assessed by the RDI-Manager algorithm\",\"sa_stat_text_two\":\"70% reliable score\",\"sa_title_nbHour\":\"Number of hours per project\",\"sa_title_achieve\":\"Realization of projects\",\"sa_big_title_strategy\":\"Strategic analysis by project\",\"sa_text_strategy\":\"With RDI-Manager, <strong>managers are entitled to specific functionalities</strong> to better analyze their projects, as well as the investment of the team on each project: – The RDI Score gives you an <strong>indication of the potential for public funding</strong> (CIR and CII) of the project – The KPIs inform you about the <strong>Efficiency and Effectiveness of the project team</strong> – The financial analysis allows you to monitor the <strong>budget of the project</strong> in real time.\",\"sa_title_time\":\"Time spent in hours per user\",\"sa_Subtitle_analysis\":\"Analysis of employee contributions\",\"sa_Subtitle_text\":\"With RDI-Manager, the manager can easily follow the specific contributions of each of his collaborators.\",\"sa_nom_profil\":\"Name\",\"sa_prenom_profil\":\"First name\",\"sa_role_profil\":\"Role\",\"sa_email_profil\":\"Email\",\"sa_telephone_profil\":\"Phone\",\"sa_statut_profil\":\"Status\",\"sa_dateEntree_profil\":\"Date of entry\",\"sa_dateSortie_profil\":\"Release date\",\"sa_value_role_profil\":\"Administrator\",\"sa_value_statut_profil\":\"Active\",\"sa_etat_dateSortie_profil\":\"Not specified\",\"line_one_one\":\"Chef de projet\",\"line_two_surLeProjet\":\"sur le projet\",\"line_one_three\":\"QUO-SIT\",\"line_two_one\":\"Contributaur\",\"line_two_three\":\"DOL\",\"line_three_one\":\"Project Manager\",\"line_three_three\":\"REICIEN\",\"line_four_one\":\"Observer\",\"line_four_three\":\"XSF\",\"line_five_one\":\"Observer\",\"line_five_three\":\"ABC\",\"line_six_one\":\"Contributor\",\"line_six_three\":\"NIHIL\",\"sa_title_resource\":\"Resources\",\"sa_title_datasheet\":\"Datasheet and Safety\",\"about_big_title\":\"About RDIManager\",\"about_text\":\"RDI-MANAGER is born from the observation of research engineers on the one hand and innovation consultants on the other hand, according to which to manage its research and innovation activity in a structured way and effective is sometimes complicated and constraining; for SMEs, Start-ups and Large Groups.\",\"about_text_why\":\"This is why we have developed in collaboration with the firm\",\"about_text_why-end\":\" and his network of innovative companies, an innovation management solution that aims to be SIMPLE, SMART and COLLABORATIVE.\",\"about_text_continued\":\"Our first product, the collaborative project journal, is mainly aimed at innovative companies. RDI-Manager brings the latter, STRUCTURING & EFFICIENCY in the capitalization of information.\",\"about_big_title_team\":\"Our team\",\"about_team_description_one\":\"Rock\\'n\\'swing lover\",\"about_team_description_two\":\"True code-addict\",\"about_team_description_three\":\"Collector car enthusiast\",\"about_team_description_four\":\"In fashion guy mode\",\"about_team_description_five\":\"Best of all at Fifa\",\"about_big_title_values\":\"Our values\",\"about_title_resilience\":\"Resilience\",\"about_history\":\"RDI-MANAGER was born in 2020, in the midst of Covid-19; the spirit of resilience that has sustained many many companies during this atypical period, is an integral part of our genetic patrimony.\",\"about_title_audacity\":\"Audacity\",\"about_audacity_description\":\"While traditional project management approaches are mainly based on planning, RDI-Manager has the courage to offer another approach: collaborative monitoring.\",\"about_service_description\":\"Through its platform, RDI-Manager is at the service of innovation and innovators in France and elsewhere.\",\"about_title_pleasure\":\"Pleasure\",\"about_description_pleasure\":\"Long before Bhutan, the Romans had already understood: Keep people happy. Our employees spend 1/3 of their days at work; so their daily happiness and well-being are part of our first-rate KPIs.\",\"part_see_web_site\":\"See their web site\",\"part_see_facebook\":\"See their Facebook\",\"contact_text\":\"Fill in your contact details below so that our teams will contact you as soon as possible.\",\"contact_name\":\"Last name\",\"contact_firstName\":\"First name\",\"contact_society\":\"Society\",\"contact_function\":\"Function\",\"contact_phone\":\"Phone number\",\"contact_subject_form\":\"Subject of your request\",\"contact_choose\":\"Select the topic that interests you\",\"contact_standard\":\"Standard offer\",\"contact_premium\":\"Premium Offer\",\"contact_other\":\"Other\",\"contact_message\":\"Message\",\"contact_mention\":\"I agree that my personal data will be collected and processed for the future business relationship.\",\"contact_send_form\":\"Send\",\"faq_big_title_one\":\"You will probably find the answer to your question in this FAQ. If you can\\'t find it, go to the section contact of our professionals will be happy to answer you.\",\"faq_question_one\":\"Is there a demo for the RDI-Manager tool ?\",\"faq_answer_one\":\"Yes, go to RDI-Manager and press the button <a href=\\\\\"https://demo.rdimanager.com/connection\\\\\" target=\\\\\"_blank\\\\\">Demo</a>. This demo allows you to put yourself in the shoes of the three roles offered by RDI-Manager (project manager, contributor, client).\",\"faq_question_two\":\"What are the different roles on RDI-Manager ?\",\"faq_answer_two\":\"<p><strong>RDI-Manager</strong> offers two classes of roles to facilitate project monitoring.</p><ul><li>Platform-wide or company-wide:<ul> <li>Administrator: can do everything</li><li>Project manager: can create projects and invite people to them</li><li>User: can monitor projects according to a very specific role</li> </li></ul><li>At the scale of a project:<ul><li>Project manager: can do everything on the project</li><li>Contributor: contributes to the project, creates remarkable fact and others</li><li>Observer: follows the project as a free listener and can comment on the remarkable fact. </li></li></ul></ul><p>The specific role of an employee in a project is independent of their role at the company level.</p>\",\"faq_question_three\":\"What are the rights of the Project Manager ?\",\"faq_answer_three\":\"<p>Whether assigned to the role of project manager or created the project himself, the Project Manager can:</p><ul><li>Set up and modify the general information of the project </li><li>Invite stakeholders (contributor and observer) to participate in the project</li><li>Add, modify or delete remarkable fact in the project regardless of the author of the remarkable fact</li ><li>Add comments to remarkable fact</li><li>Consult detailed project statistics for strategic analysis</li><li>Consult the traceability of all the actions carried out on the project page </li><li>Schedule the project by creating packages, tasks, and subtasks, then assigning project members to them</li><li>Create project-related events and inviting or notifying members of the project</li><li>Export data and information from the project page.</li></ul><p>Whether he is assigned to the role of project manager or has created the project -even, the Chef de pro jet can:</p><ul><li>Set up and modify general project information</li><li>Invite stakeholders (contributor and observer) to participate in the project</li><li>Add, edit or delete remarkable fact in the project regardless of who created the remarkable fact</li><li>Add comments to remarkable fact</li><li>View detailed project statistics for analysis strategic</li><li>Consult the traceability of all the actions carried out on the project page</li><li>Plan the project by creating batches, tasks and sub-tasks, then assigning project members to them </li><li>Create events related to projects and by inviting or informing project members</li><li>Export data and information from the project page.</li></ul>\",\"faq_question_four\":\"What are the rights of the Contributor ?\",\"faq_answer_four\":\"<p>The Project Contributor can:</p><ul><li>Add project remarkable fact,</li><li>Edit or delete their own remarkable fact,</li><li>Add from comments to remarkable fact,</li><li>Add files to the project, either directly or via a remarkable fact,</li><li>Create events in the project calendar by assigning project members to them , </li><li>Access the project planning and monitor the progress of its tasks,</li><li>Access the traceability of all the actions carried out on the project page,</li> <li>Export the project page. </li></ul><p>The Project Contributor can:</p><ul><li>Add project remarkable fact; </li><li>Edit or delete own remarkable fact; </li><li>Add comments to remarkable fact; </li><li>Add files to the project, either directly or via a remarkable fact; </li><li>Create events in the project calendar by assigning project members to them; </li><li>Access the project planning and monitor the progress of its tasks; </li><li>Access to the traceability of all the actions carried out on the project page; </li><li>Export the project page. </li></ul>\",\"faq_question_five\":\"What are the rights of the observer ?\",\"faq_answer_five\":\"<p>Project observers can be internal or external to the company. The internal observer has a right of inspection on the project. As a result, he can:</p><ul><li>Consult the remarkable fact via the project page; </li><li>View project files according to their confidentiality; </li><li>Add comments to remarkable fact; </li><li>Consult the project agenda and even create events there; </li><li>Consult the project plan; </li><li>Consult the traceability of all the actions carried out on the project page; </li><li>Export the project page. </li></ul><p>The external observer only has access to an interface for reading the remarkable fact of the project, without any visibility on the files and other data of the project. As an observer, he can comment on remarkable fact.</p>\",\"faq_question_six\":\"How to work with people outside the company (consultants, clients, etc.) ?\",\"faq_answer_six\":\"<p>Depending on their level of involvement in your project (contribution and right of scrutiny), <strong>you can invite your stakeholders to your project</strong> either as an External Observer or as an \\'Internal observer, either as a contributor. Regardless of the role played in a project, for each file added to the project, you can specify its visibility rights and thus manage its confidentiality.</p>\",\"faq_question_seven\":\"Interconnectable? Can I integrate external links like Slack to RDI-Manager ?\",\"faq_answer_seven\":\"<p>Yes, RDI-Manager is interconnectable with Slack. This allows for better communication between the teams, which increases the flow of information. Slack will send you via a dedicated channel, notifications related to time entry and the activity of your projects on RDI-Manager.</p>\",\"faq_question_eight\":\"Is RDI-Manager available in languages ​​other than French ?\",\"faq_answer_eight\":\"<p>RDI-Manager is currently available in French and English.</p>\",\"faq_question_nine\":\"What features are available during the trial period of the platform? ?\",\"faq_answer_nine\":\"<p>During the trial period, you are entitled to all the features of the platform; this is the <strong>Premium Offer</strong>. At the end of this period, you can contract to use the offer that best suits your needs or use the free offer. <a href=\\\\\"https://rdimanager.com/index.html#pricing\\\\\" target=\\\\\"_blank\\\\\">See all offers</a></p>.\",\"faq_question_ten\":\"How to create a remarkable fact in RDI-Manager ?\",\"faq_answer_ten\":\"<p>To create a remarkable fact, go to the project concerned, then click on the <i>Add a remarkable fact</i> button. Complete the form with a title, description and location. You can attach one or more files to your remarkable fact and link it to a schedule batch.</p>\",\"faq_question_ten_bis\":\"How do I resume my striking fact if I disconnect while writing it?\",\"faq_answer_ten_bis\":\"<p>If you get disconnected while writing your highlight, don\\'t panic, just log back in and click on the cross arrows icon <i>Add a highlight in a new ta</i>. On the form page, a message asking you to resume your draft appears above the form. Click on <i>Continue typing</i> and your draft will appear.</p>\",\"faq_question_eleven\":\"Does a planning tool linked to my projects exist under RDI-Manager ?\",\"faq_answer_eleven\":\"<p>Yes, absolutely, RDI-Manager has a project planning tool with which you can create tasks, which can themselves be divided into sub-tasks, also, you can assign the required collaborators to them .</p>\",\"faq_question_twelve\":\"How to interpret the RDI-Manager dashboard ?\",\"faq_answer_twelve\":\"<p>The RDI-Manager dashboard is presented in three time scales: News, Year and Multi-annuality. According to these scales: </p><ul><li>For the Employee: the scope of visibility of the dashboard is all the projects in which the employee has at least the role of observer; </li><li>For the Manager: the scope of visibility of the dashboard is all the projects in which the manager has at least the role of observer, in addition to the projects of all his collaborators; </li><li>For the Administrator: the scope of visibility of the dashboard is all the projects in which the administrator has at least the role of observer, in addition to all the projects of the society. </li></ul>\",\"faq_question_thirteen\":\"Can you customize your notifications under RDI-Manager ?\",\"faq_answer_thirteen\":\"<p>Yes, it is possible to configure all your notifications under RDI-Manager. Simply go to <i>My Account</i> by clicking on your first name at the top right of your interface, check or uncheck the notifications indicated and validate this update.</p>\",\"faq_question_fourteen\":\"Can we use RDI-Manager for all types of project ?\",\"faq_answer_fourteen\":\"<p>Absolutely! Even if RDI-Manager is initially designed as an electronic laboratory notebook, shared and adapted to the challenges of R&D in business; the collaborative project diary approach is very popular in many companies regardless of the type of project.</p>\",\"faq_question_fifteen\":\"Is the calendar connected to Outlook and Google ?\",\"faq_answer_fifteen\":\"<p>It is possible to synchronize the RDI-Manager calendar with your Outlook and google Calendar.</p>\",\"faq_question_sixteen\":\"How to embed files directly into my remarkable fact ?\",\"faq_answer_sixteen\":\"<p>In a remarkable fact, it is possible to include images and equations. It is also possible to attach files to a remarkable fact as with an email. To do this, simply click on the icon or <i>Add file</i> directly on the form and select the file on your desktop. You can also manage the visibility of this document and include it in a folder.<p>\",\"faq_question_seventeen\":\"How does time entry work on RDI-Manager ? Is it possible to change the entry of times to the day, week or month ?\",\"faq_answer_seventeen\":\"<p>Your collaborators fill in the percentage or hours of their time spent on each project. The time tracking scale is day, week or month.</p><p>The company admin decides the time tracking scale and sets it through the company settings. He can check the time tracking of each of his collaborators and export their timesheet.</p><p>Collaborators, for their part, receive a reminder by e-mail, SMS, Slack or WhatsApp so periodically so as not to forget the recording of their time on the various projects. They can view the distribution of their time on projects via the “Time Tracking” feature. </p>\",\"faq_question_eighteen\":\"Can I use RDI-Manager on my smartphone or tablet ?\",\"faq_answer_eighteen\":\"<p>Yes, the RDI-Manager platform is responsive. All you need to do is create a shortcut on your screen. A mobile application is under development and will soon arrive on the Apple and Android stores.</p>\",\"faq_question_nineteen\":\"GDPR policy and security under RDI-Manager ?  \",\"faq_answer_nineteen\":\"<p>In accordance with the General Data Protection Regulation (GDPR2); the personal data of users stored under the platform belong to them. RDI-MANGER guarantees their integrity and security. See <a href=\\\\\"https://rdimanager.com/pages/cgv.html\\\\\" target=\\\\\"_blank\\\\\">See all offers</a></p>\",\"faq_question_twenty\":\"Which offer suits me best ?\",\"faq_answer_twenty\":\"<p>The RDI-Manager commercial offers adjust to the financial, operational and strategic challenges of your company. From budding start-ups to large industrial groups, via dynamic SMEs and scale-ups, you can find what you\\'re looking for with RDI:</p><ul><li><strong> The starter offer: </ strong> it allows you to structure your project, plan tasks, share and capitalize information. It is free and limited in terms of features. It is intended for young structures with limited means.</li><li><strong> The standard offer:</strong> it gives access to almost all the features of the application. It is suitable for small and medium-sized structures.</li><li><strong>The premium offer: </strong> beyond 20 users (contributors), with several teams and hierarchical levels, you can subscribe to the premium offer. Large companies can also request self-hosting of the application on their servers.</li></ul>\",\"faq_question_twenty_one\":\"Can I change my RDI-Manage packager ?\",\"faq_answer_twenty_one\":\"<p>Yes, at any time, you can contact RDI-MANAGER customer service to adjust your package according to your needs.</p>\",\"join_textRec\":\"If you want to participate in a dynamic entrepreneurial project and innovative, in a start-up atmosphere; do not hesitate to contact us send your CV, telling us about your motivations.\",\"join_attachment\":\"Attachment / Resume\",\"rg_big_title\":\"Roles in RDI-Manager\",\"rg_title_admin\":\"Administrator\",\"rg_text_admin\":\"The administrator has all the rights under the RDI-Manager platform. He can invite users, create projects, add people to them and use strategic management features.\",\"rg_title_chief\":\"Project Manager\",\"rg_text_chief\":\"The project manager has the right to create projects and to invite contributors and observers. He also has access to the statistical analyzes of his projects.\",\"rg_title_user\":\"User\",\"rg_text_user\":\"The user only has visibility on his scope of projects. He can be an observer or a contributor in the projects; and even play the role of leader of a project that he did not create. He does not have the right to create a project.\",\"rm_big_title\":\"Rights and management of project files under RDI-Manager\",\"rm_title_right\":\"File visibility rights\",\"rm_text_right\":\"When you add a file to a project, either via a remarkable fact or via the project\\'s file management interface; you can specify who can see the file. Those who do not have file visibility rights are not even aware of its existence under the platform.\",\"rm_title_management\":\"Managing files in folders\",\"rm_text_management\":\"In your RDI-Manager project log, you can create and name folders in which you want to store your files. Every time you add a file, either via a remarkable fact or via the project file management interface; you can choose the folder in which you want to store it.\",\"sh_big_title\":\"Data security and hosting on RDI-Manager\",\"sh_title_security\":\"Enhanced data security\",\"sh_text_security_one\":\"The security of your data is our priority: you own your data and we guarantee its integrity.\",\"sh_text_security_two\":\"<strong>The RDI-Manager platform is based on a dual security approach:</strong>  \",\"sh_text_security_three\":\"- Our engineers have integrated the latest security techniques and technologies for PHP applications\",\"sh_text_security_four\":\"- Our OVH cloud infrastructure is also equipped with advanced security and data backup protocols.\",\"sh_text_security_five\":\" In addition, RDI-MANAGER complies with European standards and regulations in terms of IT and freedom.\",\"sh_title_ovh\":\"FR-EU or internal cloud infrastructure\",\"sh_text_ovh_one\":\"OVH Cloud, the number 1 European cloud computing solution, is the hosting partner of the RDI-Manager platform. <strong>Your data is therefore hosted on French soil in good security.</strong>\",\"sh_text_ovh_two\":\"We also give you the option of subscribing to the RDI-Manager premium offer, which gives you the opportunity to <strong>host your data on your own servers</strong>. Maintenance and updates will be provided by the RDI-Manager team in collaboration with your CIO.\",\"plan_big_title\":\"Advanced project planning\",\"plan_text\":\"Define the planning of your project following the classic approach: Project – Lots – Tasks – Sub-tasks by specifying the start and end dates of the latter. You can also assign collaborators to different batches and tasks in order to properly distribute the work.\",\"plan_discover_plan\":\"Discover the Planning\",\"plan_cardRed_title\":\"Batches/Tasks/Subtasks\",\"plan_cardRed_subtitle_one\":\"Feasibility study\",\"plan_cardRed_subtitle_two\":\"Financial report\",\"plan_cardRed_subtitle_three\":\"Test phase\",\"plan_cardRed_subtitle_four\":\"Project organisation\",\"plan_cardRed_subtitle_five\":\"Conception\",\"plan_cardW_title\":\"ABC Project Planning\",\"plan_cardW_dateOne\":\"Week 1\",\"plan_cardW_dateTwo\":\"Week 2\",\"plan_cardW_dateThree\":\"Week 3\",\"plan_cardW_dateFour\":\"Week 4\",\"plan_cardW_dateFive\":\"Week 5\",\"plan_cardW_dateSix\":\"Week 6\",\"plan_cardW_dateSeven\":\"Week 7\",\"plan_ban_title\":\"Advanced project planning and monitoring\",\"plan_ban_text_one\":\"Thanks to the planning of your project, your project contributors can <strong>associate remarkable fact with a very specific project package</strong>. You will therefore be able to view the remarkable fact of the different lots of the project.\",\"plan_ban_text_two\":\"The follow-up of the progress of your tasks is carried out via:\",\"plan_ban_text_three\":\"- a <strong>follow-up system before the due date of each task</strong> in order to update its progress\",\"plan_ban_text_four\":\"- notifications of complete completion of tasks.\",\"plan_ban_text_five\":\" In addition, performance indices <strong>measure your efficiency and effectiveness in completing tasks throughout the project</strong>.\",\"hierachy_FB_bigTitle\":\"Visualize your employees via an organization chart\",\"hierachy_FB_text\":\"As a manager within your company, your employees can define your hierarchical link under the RDI-Manager platform. This allows you to see all your collaborators in the form of an organization chart up to order N-2\",\"hierachy_FB_discover\":\"Discover the hierarchy\",\"hierachy_FB_roleChief\":\"Project Manager\",\"hierachy_FB_roleAdmin\":\"Administrator\",\"hierachy_FB_roleContributor\":\"Contributor\",\"hierachy_SB_bigTitle\":\"The Employee defines his N+1\",\"hierachy_SB_text\":\"From their <strong>My Account</strong> space in the company, each employee can identify their line manager. This automatically allows hierarchical superiors of order N+1 and N+2 to have visibility on the employee\\'s projects.\",\"hierachy_TB_bigTitle\":\"The Big Picture of my team\",\"hierachy_TB_text\":\"As a Manager, I can see my entire team via an organization chart under RDI-Manager. In addition, I have a right of visibility on all their projects, whatever the role I play (Observer / Contributor / Project Manager).\",\"sa_title_timeProject\":\"Time spent in hours per project\",\"sa_title_hisProjects\":\"His projects\",\"sa_budget_title\":\"Budget analysis\",\"sa_budget_subTitle\":\"In hours (H)\",\"sa_boardTitle\":\"Budget analysis in Hours (H)\",\"sa_board_previs\":\"Forecast\",\"sa_board_real\":\"Real\",\"sa_board_euro\":\"In euros (€)\",\"sa_perf_title\":\"Performance indicators\",\"sa_perf_efficacity\":\"Efficiency\",\"sa_perf_efficacity_descr\":\"Indicates your ability to complete tasks on time\",\"sa_perf_Effectiveness\":\"Effectiveness\",\"sa_perf_Effectiveness_descr\":\"Indicates your level of completeness in completing project tasks\",\"sa_title_proj_stat\":\"Project contribution statistics\"}');\n\n//# sourceURL=webpack:///./translation/en.json?");

